
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['os', 'requests', 'ujson', 'subprocess', 'keyboard', 'rich', 'datetime', 'hashlib', 'httpx', 'asyncio', 'ctypes']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'\xc8\xd6\xe5\x92\xfd=\xf5\xbb\x7f\xdff7\xe2\xb7\xd1\x03\xf9\x98k\xaeS\xe9^\x92Z-\x1cO=\xa5.:', b'\xb5k\x90\xdbq\xca\x18\t\xbbp\r\x05\x87\xad\x15?\x14\xc4\x7f"\xcf\xf5.\xe2\x99\xfe\xa1\x9e\x82\x81\xbdu', b'\xef\xf9#\x8c\x7fbS\xbe\x96\xcc\xbfBo?\x7f\xcd\x0e\x94\x8a\xff;J}\xd8\n\xa3$\xb1\xd1\xf9\xf8g'])
_I = _xor([b"\x0b$\xbam\xe7\xc2\x8c'/u)p\x89V}:", b'\x8b\x15f\x19(\xe2&\xc2Pq|\xef\x8a\x9a\xdeF'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

